import "../Main.css";
import logo from "../images/molloy-logo.png";
import molloy from "../images/Molloy.png";
export default function Main() {
  let width = window.innerWidth;
  console.log(width);
  const handleClick = () => {
    alert("Discover Button - useHistory not working");
  };
  return (
    <main id="main">
      <img src={molloy} alt="Molloy University" id="molloycampus"></img>
      <div className="centered">
        <h1>Textbook Exchange</h1>
        <h3>Helping students handle their textbooks</h3>
        <button className="button" onClick={handleClick}>
          Click here to discover
        </button>
      </div>
    </main>
  );
}
